async function main() {
    try {
        // List all monitors
        const monitors = await getMonitors();
        console.log('Monitors:', monitors);
        
        // Create a new monitor
        const newMonitor = await createMonitor({
            name: 'My API Endpoint',
            url: 'https://api.example.com/health',
            type: 'http',
            interval: 60,
            timeout: 30,
            retries: 3
        });
        console.log('Created monitor:', newMonitor);
        
        // Get status of a specific monitor
        const status = await getMonitorStatus(newMonitor.data.id);
        console.log('Monitor status:', status);
    } catch (error) {
        console.error('Error:', error);
    }
}

